import { Profiler } from 'react';
import { Link } from 'react-router-dom'

function ActorCard(props) {
    const link = 'https://image.tmdb.org/t/p/w500'

    return (
        <Link to={'person/' + props.data.id} className="actor-card">
            <div className="actor-card-top">
                <img className="actor-card-profile" src={link + props.data.profile_path} alt="" />
            </div>
            <div className="actor-card-info">
                <h1 className="actor-card-name">{props.data.name}</h1>
                <p className="actor-card-sphere">{`Trending For ${props.data.known_for_department}`}</p>
            </div>
        </Link>
    )
}

export default ActorCard;
